# Scheme:
#
# korok types:
# .meta.types[<TYPE>]:
#   name: string
#   icon: string
#
# korok regions:
# .meta.regions[<PREFIX>]:
#   name: string
#   count:
#     main: number
#     sky: number
#
# main korok data:
# .data[<ID>]:
#   type: string
#   hash: string
#   extra_hashes?: arrayof string
#   move: arrayof [x, y, z] - movements.
#                single point for lift rock, confetti, etc
#                2 points for races, etc
#                more points for flowers, etc

# TODO:
# Through the Roof" -> Ascend (Start/Finish, maybe)
  # Rock Lift" -> Lift Rock ////?

